import logo from './logo.svg';
import './App.css';
import React, {useContext} from 'react';

var session = {
  loggedIn: false,
}

const SessionContext = React.createContext(session);

function App() {
  return (
    <div className="App">
      <SessionContext.Provider value={session.loggedIn}>
          <Test/>
      </SessionContext.Provider>
    </div>
  );
}

const Test = () => {
    const getSession = useContext(SessionContext);
    return (
        <div>Hello, you are {getSession.loggedIn ? "not" : null} logged in</div>
    )
}

export default App;
